%[text] # Volume Rendering
clearvars
close all
%[text] ## Medical Volume Viewer
mmSetUnitDataFolder(3) % set current folder to unit3 data folder %[output:7d9edf6f]
intMV = medicalVolume("MedicalVolumeDICOMData/LungCT01"); % load DICOM as a medicalVolume
%%
medicalVolumeViewer(intMV) % display volume 
%%
lblMV = medicalVolume("LungCT01_vertebra.nii.gz") %[output:431ec5bf]
%%
%[text] ## volshow
%[text] ### Load Volumes
clearvars
close all hidden
segMV = medicalVolume("CTACardio/Salcedo Segmentation.seg.nrrd"); % label volume %[output:6e9df02a]
intMV = medicalVolume("CTACardio/CTACardio Crop.nrrd");
%%
%[text] ### Display with VolShow
hvs = volshow(intMV) %[output:5b79f8af] %[output:9c59c317]
%%
%[text] ### Modify Background using viewer3d
hvr = viewer3d(parent=uifigure,BackgroundColor="white",BackgroundGradient="off",CameraZoom=1); % set background color to white and turn off gradient
hvs = volshow(intMV,parent=hvr);
%%
%[text] #### Adjust Camera position
%[text] default is to show the posterior of the cadaver. So, let's flip that
hvr.CameraPosition(1:2) = -hvr.CameraPosition(1:2); % Anterior forward by moving camera
%%
%[text] ### Modify Rendering Style
hvs.RenderingStyle = "GradientOpacity";
hvs.GradientOpacityValue = .1;
%%
%[text] ### Adjust Colormap
hvs.Colormap = parula; %[output:9a75a750]
%%
%[text] ### Add Title to Window
hvr.Title = "CTACardio";
%%
%[text] ### Apply Medical Colormaps using course function
%[text] The course function **`mmSetVolShowColors`** sets the background to white (default setting) and applies a selected Medical Colormap. These colormaps are the same as are found in the MedicalVolumeViewer. When you run the function, you are given the option of selecting a colormap.
hvs = volshow(intMV);
mapName = mmSetVolShowColors(hvs) %[output:51ce2ce1] %[output:1b2f7e3d]
%%
%[text] ### Overlay label maps
hvs = volshow(intMV,OverlayData=segMV.Voxels, ... % first input is the intensity Volume
    RenderingStyle="GradientOpacity", ...
    OverlayAlpha=0.4); % reduce label opacity
hvs.Parent.BackgroundGradient = 'off'; % set figure gradient off
hvs.Parent.BackgroundColor = 'white'; % set figure background to white %[output:17e553d5]
%%
hvs.Parent.CameraPosition(1:2) = -hvs.Parent.CameraPosition(1:2); % Anterior forward by moving camera
%%
mmSetVolShowColors(hvs,MapName="CTBoneShift") %[output:2bee9a63]
%%
hvs = volshow(segMV,RenderingStyle="Isosurface",Colormap=parula(3));
hvs.Parent.BackgroundColor='white'; %[output:851ba0d4]
hvs.Parent.BackgroundGradient="off";
%%
hvs.OverlayColormap = parula; %[output:8600ecc9]
%%
